import sysfrom PyQt5 import QtCore, QtGui, QtWidgetsfrom PyQt5.QtGui import QIconfrom ui import Ui_Dialogclass Game(QtWidgets.QDialog):    def __init__(self, _gL):        super(Game, self).__init__()        self.ui = Ui_Dialog()        self.ui.setupUi(self)        self.init_Ui(_gL)    def init_Ui(self, _gL):        self.setWindowTitle('Game')        self.setWindowIcon(QIcon('icon.png'))        self.ui.button1.clicked.connect(_gL.lookAround)        self.ui.button2.clicked.connect(_gL.shoutOut)        self.ui.buttonN.clicked.connect(_gL.north)        self.ui.button1.clicked.connect(_gL.south)        self.ui.button1.clicked.connect(_gL.east)        self.ui.button1.clicked.connect(_gL.west)class Game_logic:    def lookAround(self):        print('Connect button1')    def shoutOut(self):        print('Connect button2')    def north(self):        print('Connect buttonN')    def south(self):        print('Connect buttonS')    def east(self):        print('Connect buttonE')    def west(self):        print('Connect buttonW')gL = Game_logicapp = QtWidgets.QApplication([])application = Game(gL)application.show()sys.exit(app.exec())